import React, { useState } from "react";
import emailjs from "emailjs-com";

const Contact = ({ data }) => {
  //   //eslint-disable-next-line
  //   const [url, setUrl] = useState(
  //     "mailto:rigvedbhavsar@gmail.com?subject=subject&body=body"
  //   );
  //   const [name, setName] = useState("");
  //   const [subject, setSubject] = useState("");
  //   const [email, setEmail] = useState("");
  //   const [message, setMessage] = useState("");

  //   console.log(data);

  const handleClick = (e) => {
    // window.open(`mailto:${email}?subject=${subject}&body=${name}: ${message}`);
    e.preventDefault();
    emailjs
      .sendForm(
        "gmail",
        "template_8a21ovs",
        e.target,
        "user_ERMwHtde6r6Is8FxjZoZo"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
    e.target.reset();
  };

  return (
    <section id="contact">
      <div className="row section-head">
        <div className="two columns header-col">
          <h1>
            <span>Get In Touch.</span>
          </h1>
        </div>

        <div className="ten columns">
          <p className="lead">{data?.message}</p>
        </div>
      </div>

      <div className="row">
        <div className="eight columns">
            <form onSubmit={handleClick}>
                    <div>
                        <label htmlFor="contactName">Name <span className="required">*</span></label>
                        <input type="text" defaultValue="" size="35" id="contactName" name="name"/>
                    </div>

                    <div>
                        <label htmlFor="contactEmail">Email <span className="required">*</span></label>
                        <input type="text" defaultValue="" size="35" id="contactEmail" name="email"/>
                    </div>

                    <div>
                        <label htmlFor="contactSubject">Subject</label>
                        <input type="text" defaultValue="" size="35" id="contactSubject" name="subject"/>
                    </div>

                    <div>
                        <label htmlFor="contactMessage">Message <span className="required">*</span></label>
                        <textarea cols="50" rows="15" id="contactMessage" name="message"></textarea>
                    </div>

                    <div>
                        <input type="submit" className="submit">Submit</input>
                        {/* <button type='submit' onClick={handleClick} className="submit">Submit</button> */}
                        <span id="image-loader">
                        <img alt="" src="images/loader.gif" />
                        </span>
                    </div>
               </form>

          {/* <form className="contact-form" onSubmit={handleClick}>
            <label>Name</label>
            <input type="text" name="name" />
            <label>Email</label>
            <input type="email" name="email" />
            <label>Message</label>
            <textarea name="message" />
            <input type="submit" value="Send" />
          </form> */}

          <div id="message-warning"> Error boy</div>
          <div id="message-success">
            <i className="fa fa-check"></i>Your message was sent, thank you!
            <br />
          </div>
        </div>

        <aside className="four columns footer-widgets">
          <div className="widget widget_contact">
            <h4>Address and Phone</h4>
            <p className="address">
              {data?.name}
              <br />
              {data?.address.street} <br />
              {data?.address.city}, {data?.address.state} {data?.address.zip}
              <br />
              <span>{data?.phone}</span>
            </p>
          </div>

          <div className="widget widget_tweets"></div>
        </aside>
      </div>
    </section>
  );
};

export default Contact;
